.documentation {
	padding-top: 0;
	max-width: 100%;
}

.documentation .content-wrapper {
	padding-top: 0;
	min-height: calc(100vh - 75px);
}

.doc-header {
	position: fixed;
	padding-top: 24px;
	padding-bottom: 24px;
	z-index: 2;
	background: #f3f3f3;
}

.doc-content {
	padding-top: 157px;
}

.dashboard-chart-legend {
	list-style-type: none;
	padding-left: 0;
}

.dashboard-chart-legend li {
	display: inline;
}

.dashboard-chart-legend li span {
	width: 11px;
	height: 11px;
	border-radius: 50%;
	display: inline-block;
	margin-right: 7px;
}

.dashboard-chart-legend li:not(:first-child) span {
	margin-left: 25px;
}

@media (max-width: 576px) {
	.dashboard-chart-legend li:not(:first-child) span {
		margin-left: 13px;
	}
}

.dashboard-tabs .item {
	border-bottom: 1px solid #f3f3f3;
}

@media (min-width: 577px) {
	.dashboard-tabs .item {
		border-bottom: 0;
	}
}

.nav-tabs {
	border: 1px solid #f3f3f3;
}

.nav-tabs .nav-link {
	background: #f6f8fa;
	color: #000000;
	border-radius: 0;
	border: 1px solid #f3f3f3;
	padding: 1rem 1.5rem 0.2rem 1.5rem;
}

@media (max-width: 767px) {
	.nav-tabs .nav-link {
		padding: 1rem 0.5rem 0.2rem 0.5rem;
	}
}

.nav-tabs .nav-item .nav-link {
	border: 0;
	background: transparent;
}

.nav-tabs .nav-item .nav-link.active {
	border: 0;
	border-bottom: 3px solid #5646ff;
	color: #4d83ff;
}

