/* Cards */
.card {
	box-shadow: none;
	-webkit-box-shadow: none;
	-moz-box-shadow: none;
	-ms-box-shadow: none;
}

.card .card-body {
	padding: 1.5rem 1.875rem;
}

.card .card-body+.card-body {
	padding-top: 1rem;
}

.card .card-title {
	color: #4a4a4a;
	margin-bottom: 1.5rem;
	text-transform: uppercase;
	font-size: 0.875rem;
	font-weight: bold;
}

.card .card-subtitle {
	font-weight: 400;
	margin-top: 0.625rem;
	margin-bottom: 0.625rem;
}

.card .card-description {
	margin-bottom: 0.875rem;
	font-weight: 400;
	color: #76838f;
}

.card.card-outline-success {
